function searchRel(){var b=$("#datainicial");var a=$("#datafinal");toastr.options={closeButton:true,debug:false,newestOnTop:false,progressBar:true,positionClass:"toast-top-right",preventDuplicates:false,onclick:null,showDuration:"300",hideDuration:"1000",timeOut:"5000",extendedTimeOut:"1000",showEasing:"swing",hideEasing:"linear",showMethod:"fadeIn",hideMethod:"fadeOut"};if((b.val()).length<1){toastr.warning("O campo Data Incial é Obrigatório","Atenção");b.focus()}else{if((a.val()).length<1){toastr.warning("O campo Data Final é Obrigatório","Atenção");a.focus()}else{b=b.val();a=a.val();$.ajax({url:"ajax/relatorio/rel_venda.php",type:"POST",data:"datainicial="+b+"&datafinal="+a,success:function(e){var d=10;var f=0;var g=new jsPDF();pageHeight=g.internal.pageSize.height;g.setFontSize(14);g.text(10,10,("Número Pedido"));g.text(60,10,("Cliente"));g.text(120,10,("Data"));g.text(160,10,("Valor do Pedido"));$.each(e,function(i,j){var h=j.guid;var l=j.nome;var n=j.data;var m=j.total;var k=4;m=accounting.formatMoney(m,"",2,".",",");n=moment(n).format("DD/MM/YYYY");g.text(10,(d+10),(h));g.text(60,(d+10),(l));g.text(120,(d+10),(n));g.text(160,(d+10),("R$ "+m));m=parseFloat(m);f=(f+m);d=d+10});f=accounting.formatMoney(f,"R$ ",2,".",",");g.text(160,(d+10),"Total");g.text(160,(d+20),(f));var c=g.output("dataurlnewwindow")},error:function(c,e,d){alert("Status: "+e);alert("Error: "+d);console.log(arguments)}})}}};